import React from 'react'

const Sponsor = () => {
  return (
    <div className="bg-gray-300/50 w-full h-20 translate-y-60">
        <div className="flex justify-evenly">
            <img src='./assets/shopify.png' ></img>
        </div>
    </div>
  )
}

export default Sponsor
